import React from 'react';
import './List.css';
import Card from'./Card.js';
import STORE from './store.js';

const stuff = {a:{title:'one',content:'stuff'},b:{title:'two',content:'stuff'},c:{title:'three',content:'stuff'}};

function List(props){

    const cards = stuff.map((item) => <Card title={item.title} content={item.content}/>);
    let test = STORE.allCards;
    let test2 = props.cardIds[0];
    console.log(test2);
    console.log(test);

    return(<section className='List'>
        <header className='List-header'>
            <h2>{props.header}</h2>
        </header>
        <div className='List-cards'>
            {cards}
        </div>
        <button type='button' className="List-add-button">
            + Add Random Card
        </button>
    </section>);
}

export default List;
